import React from "react";
import { connect } from "react-redux";


function HomePage(props) {
  return (
    <>
      {props.products.map((productObj) => {
        return (
          <div key={productObj.id}>
            <img src={productObj.image} style={{height:"10rem"}} />
            <div><h2>{productObj.title}</h2></div>
            <div><h3>{productObj.price}</h3></div>
            <div><p>{productObj.description}</p></div>
          </div>
        );
      })}
    </>
  );
}

const mapStateToProps = (store) => {
  return store;
};

export default connect(mapStateToProps)(HomePage);
